import React from 'react'

const Button = (props) => {
  return (
    <div className = 'btndiv'>
      <button className = {props.class} onClick = {props.onClick}>
        <span className = 'btntext'>{props.text}</span>
      </button>
    </div>
  );
}

Button.defaultProps = {
  class: 'btn',
  text: 'Let\s go!'
}

export default Button
